import React from 'react';
import Cards from './components/cards/Cards';
import Navbar from './components/navbar/Navbar';
import { CardData } from './utils/CardsData';


export default function App() {
  return (
    <>
      <Navbar />
      {
        CardData.map (
          (Card,i) => {
            return (
              <Cards
              key = {i}
              title = {Card.title}
              color = {Card.color}
              icon = {Card.icons}
              />
            )
          }
        )
      }
    </>
  );
}
